export class session{
    isSessionSelected : boolean;
    sessionId : string;
    sessionName : string;
    sessionTime : [{}]

    constructor (){
        this.isSessionSelected = false;
        this.sessionId  = "";
        this.sessionName ="";
        this.sessionTime = [{}];
    }

    static getAllSessions(): session[] {
        return [
          { sessionId: '0', sessionName: 'Session 1', sessionTime: [{timeOne: "9:00 AM - 10:00 AM", timeTwo: "10:00 AM - 11:00 AM"}], isSessionSelected: false },
          { sessionId: '1', sessionName: 'Session 2', sessionTime: [{timeOne: "9:00 AM - 10:00 AM", timeTwo: "10:00 AM - 11:00 AM"}], isSessionSelected: false },
        ];
      }



}
